import React, { Component } from 'react'

export default class ListTasks extends Component {
    constructor(props) {
        super(props)
        this.state = {
            Tasks: [{}]
        }
    };
    render() {
        return (
            <div className="table-responsive">
                <table className="table">
                    <thead>
                        <tr>
                            <th>No.</th>
                            <th>Name</th>
                            <th>Type</th>
                            <th>Status</th>
                            <th>StartDate</th>
                            <th>EndDate</th>
                        </tr>
                    </thead>
                    <tbody>
                        {this.state.Tasks.length > 1 ? this.state.Tasks.map((Task, index) => {
                            return (
                                <tr key={index}>
                                    <td>{index}</td>
                                    <td>{Task.Name}</td>
                                    <td>{Task.Type === 1 ? "Urgent" : "Midium"}</td>
                                    <td>{Task.Status === 1 ? "Pending" : "Assigned"}</td>
                                    <td>{Task.StartDate !== null ? Task.StartDate.toLocaleString().split(',')[0] : ""}</td>
                                    <td>{Task.EndDate !== null ? Task.EndDate.toLocaleString().split(',')[0] : ""}</td>
                                </tr>
                            )
                        }) : <tr className="no-data">
                                <td colSpan="6">No data to display</td>
                            </tr>
                        }
                    </tbody>
                </table>
            </div>
        )
    }
}
